import React from 'react'
import { View, Text, Image, ImageBackground, StyleSheet, SafeAreaView, TextInput } from 'react-native';
import { Fontisto as Icon } from '@expo/vector-icons'

const Home = () => {
    return (
        <SafeAreaView style={Styles.container}>
            <View style={Styles.top}>
                <View>
                    <Text
                        style={Styles.subtitle}>
                        Boleto Digital
                    </Text>
                    <Text
                        style={Styles.title}>
                        PRATICIDADE{'\n'}NA DISTÂNCIA{'\n'}DE UM TOQUE
                    </Text>
                </View>
                <View style={Styles.areaIcon}>
                    <Icon
                        style={{ textAlign: 'center' }}
                        name="whatsapp"
                        color="#fff"
                        size={24}
                    />
                    <Text style={Styles.subtitle}>9 9249-2222</Text>
                </View>
            </View>
            <View >
                <Image
                    source={require('../../assets/logo.png')}
                    style={Styles.image}
                />

                <Text>Usuário</Text>
                <TextInput
                    placeholder="Insira seu usuário"
                    autoCorrect={false}
                    autoCompleteType="off"
                />
                
                <Text>Senha</Text>
                <TextInput
                    placeholder="Insira sua senha"
                    secureTextEntry={true}
                />

            </View>
        </SafeAreaView>
    )
}

export default Home;

const Styles = StyleSheet.create({
    top: {
        backgroundColor: '#26d40f',
        flexDirection: 'row',
        flexWrap: 'wrap',
        justifyContent: 'space-between',
        alignItems: 'center'
    },
    bottom: {
        backgroundColor: '#000'
    },
    container: {
        flex: 1,
        justifyContent: 'flex-start',
        alignContent: 'flex-start'
    },
    image: {
        width: 190,
        height: 200,
        resizeMode: 'contain',
        alignSelf: 'flex-end',
        marginRight: '3%',
        marginBottom: '20%'
    },
    subtitle: {
        paddingLeft: 15,
        fontSize: 24,
        fontWeight: '300',
        color: '#fff'
    },
    title: {
        paddingLeft: 15,
        fontSize: 32,
        fontWeight: 'bold',
        color: '#fcf800',
    },
    areaIcon: {
        alignSelf: 'center',
    },
    areaInput: {
        justifyContent: 'space-around',
        alignItems: 'center'
    }
})
